import { HelpButtonWithTooltip } from "../HelpButtonWithTooltip";
import { TimelineControls } from "./TimelineControls";

export const TimelineHeader = ({
  draggedItem,
  isDragging,
  setShowExportModal,
  isTimelineDragging,
  isResizing,
  dropPreview,
  draggedTimelineItem,
  resizeItem,
  resizeHandle,
  copiedItem,
  timelineZoom,
  selectedTimelineItem,
  addOverlayTrack,
  addAudioTrack,
  addToTimelineAtCurrentTime,
  splitTimelineItem,
  copyTimelineItem,
  pasteTimelineItem,
  deleteSelectedItem,
  zoomIn,
  zoomOut,
  resetZoom,
}) => {
  const getStatusMessage = () => {
    if (draggedItem) {
      const trackType =
        draggedItem.type === "video"
          ? "Main Video"
