            <HelpButtonWithTooltip />
          </div>
           <button
            onClick={handleDownloadOpen}
            className="relative px-4 py-2 bg-gradient-to-r from-indigo-500 via-purple-500 to-pink-500 hover:from-indigo-600 hover:via-purple-600 hover:to-pink-600 text-white font-bold text-sm rounded-xl shadow-[0_6px_25px_rgba(139,69,193,0.3)] hover:shadow-[0_10px_35px_rgba(139,69,193,0.5)] transform hover:scale-105 transition-all duration-500 animate-pulse hover:animate-none group overflow-hidden"
            title="Ð­ÐºÑÐ¿Ð¾Ñ€Ñ‚ Ð³Ð¾Ñ‚Ð¾Ð²Ð¾Ð³Ð¾ Ð²Ð¸Ð´ÐµÐ¾"
          >
            <div className="absolute inset-0 bg-gradient-to-r from-pink-500 via-red-500 to-yellow-500 opacity-0 group-hover:opacity-100 transition-opacity duration-500"></div>

            <div className="relative flex items-center gap-2">
              <span className="text-base animate-bounce">ðŸŽ¬</span>
              <div className="flex items-center gap-1">
                <Download
                  size={16}
                  className="group-hover:translate-y-1 transition-transform duration-300"
                />
                <span className="tracking-wide">Export</span>
              </div>
              <span className="text-base animate-spin group-hover:animate-none">
                âœ¨
              </span>
            </div>

            <div
              className="absolute top-1 left-1/4 w-1 h-1 bg-white rounded-full opacity-80 animate-ping"
              style={{ animationDelay: "0s" }}
            ></div>
            <div
              className="absolute bottom-1 right-1/4 w-0.5 h-0.5 bg-white rounded-full opacity-60 animate-ping"
              style={{ animationDelay: "1s" }}
            ></div>
          </button>
        </div>
      </div>
